import React, {Component} from 'react';
import './App.css';



export class Map extends Component {
    constructor(props:any) {
        super(props);
        this.state = { items: [] };
    }

    render() {
        return (
            <div className="MapBox">
                <h1>View All</h1>
            </div>
        );
    }

}

export default Map;
